// ============================================
// 서비스 데이터 로더 (동기 실행)
// ============================================

console.log('[DATA_SERVICE] 초기화 시작...');

// 압축된 데이터
var COMPRESSED_SERVICE_DATA = "";

// 즉시 SERVICE_DATA 변수 생성
window.SERVICE_DATA = null;
window.DATA_SERVICE_LOADED = false;

// 데이터 해제 함수
(function loadServiceDataSync() {
    console.log('[DATA_SERVICE] 데이터 해제 시작...');
    
    var retryCount = 0;
    var maxRetries = 100; // 10초
    
    function tryLoad() {
        // pako 체크
        if (typeof pako === 'undefined') {
            retryCount++;
            if (retryCount < maxRetries) {
                console.log('[DATA_SERVICE] pako 대기 중... (' + retryCount + '/' + maxRetries + ')');
                setTimeout(tryLoad, 100);
                return;
            } else {
                console.error('[DATA_SERVICE] pako 로딩 실패');
                alert('데이터 로딩 라이브러리(pako)를 불러오지 못했습니다.\n인터넷 연결을 확인해주세요.');
                return;
            }
        }
        
        try {
            // base64 디코딩
            var binaryString = atob(COMPRESSED_SERVICE_DATA);
            var bytes = new Uint8Array(binaryString.length);
            for (var i = 0; i < binaryString.length; i++) {
                bytes[i] = binaryString.charCodeAt(i);
            }
            
            // gzip 해제
            var decompressed = pako.ungzip(bytes, { to: 'string' });
            
            // JSON 파싱
            window.SERVICE_DATA = JSON.parse(decompressed);
            window.DATA_SERVICE_LOADED = true;
            
            console.log('[DATA_SERVICE] ✅ 로딩 완료: ' + SERVICE_DATA.length.toLocaleString() + '건');
            
            // 커스텀 이벤트 발생
            var event = new Event('SERVICE_DATA_READY');
            window.dispatchEvent(event);
            
        } catch (error) {
            console.error('[DATA_SERVICE] ❌ 해제 실패:', error);
            retryCount++;
            if (retryCount < maxRetries) {
                setTimeout(tryLoad, 100);
            } else {
                alert('데이터 로딩에 실패했습니다.\n페이지를 새로고침 해주세요.');
            }
        }
    }
    
    tryLoad();
})();
